var opentype = require('opentype.js');
class TOFontLoader {
    static fontList = {};
    static callbackList = {};

    static load(fontPath, callback){
        if (this.fontList[fontPath]){
            callback(null,this.fontList[fontPath]);
        }
        if (this.callbackList[fontPath]){
            this.callbackList[fontPath].push(callback);
        }else{
            this.callbackList[fontPath] = [callback];
            opentype.load(fontPath,(error,font)=>{
                if (!error){
                    this.fontList[fontPath] = font;
                }
                let callbackList = this.callbackList[fontPath];
                for (const key in callbackList) {
                    if (callbackList.hasOwnProperty(key)) {
                        const element = callbackList[key];
                        element(error, font);
                    }
                }
                this.callbackList[fontPath] = null;
            });
        }
    }
    static loadEmoji(callback){
        let fontPath = "emoji";
        if (this.fontList[fontPath]){
            callback(null,this.fontList[fontPath]);
        }
        if (this.callbackList[fontPath]){
            this.callbackList[fontPath].push(callback);
        }else{
            this.callbackList[fontPath] = [callback];
            let emojiFont = new TOEmojiFont();
            emojiFont.load((error)=>{
                if (!error){
                    this.fontList[fontPath] = emojiFont;
                }
                let callbackList = this.callbackList[fontPath];
                for (const key in callbackList) {
                    if (callbackList.hasOwnProperty(key)) {
                        const element = callbackList[key];
                        element(error, emojiFont);
                    }
                }
                this.callbackList[fontPath] = null;
            });

        }
    }
};

class TOFont{
    constructor(fontFamily,callback){
        this.fontList = {};
        this.isReady = false;
        if (!fontFamily){
            fontFamily = "./wawati.ttf";
        }
        this.loadFonts(this,fontFamily.split(","),0,(error)=>{
            callback(error,this);
            });
    }
    
   
    loadFonts(toFont,fontList,index,callback) {
        if (index < fontList.length){
            let path = fontList[index];
            TOFontLoader.load(path,(error,font)=>{
                if (error){
                    callback(error);
                }else{
                    toFont.fontList[path] = font;
                    toFont.loadFonts(toFont,fontList,index+1,callback);
                }
            });
            
        }else{
            //åŠ è½½è¡¥å……é”™è¯¯å­—ä½“
            TOFontLoader.load("./notdef.ttf",(error,font)=>{
                if (error){
                    callback(error);
                }else{
                    toFont.notdef= font;
                    TOFontLoader.loadEmoji((error,font)=>{
                        if(!error){
                            toFont.emoji = font;
                            this.isReady = true;
                        }
                        callback(error);
                    });
                }
            });
        }
    };
    readGlyph(char) {
        for (let item in this.fontList){
            let glyph = this.fontList[item].charToGlyph(char)
            if (glyph.unicode !== undefined){
                return glyph;
            }
        }
        
        let glyph = this.emoji.charToGlyph(char);
        if (glyph){
            return glyph;
        }
        return this.notdef.charToGlyph(char);
    };
    
}

class TOParagraph{
    constructor(str,font,width,fontSize){
        if(!fontSize){
            fontSize = 14;
        }
        
        this.str = str;
        this.font = font;
        this.width = width;
        this.fontSize = fontSize;
    };

    readLines (width){
        let strArr = Array.from(this.str);
        let lines = [];
        let linePaths = [];
        let lineWidth = 0;
        let lineStr = "";
        
        for (let i=0;i<strArr.length;i++){
            let tempStr = strArr[i];
            //æ¢è¡Œç¬¦å¤„ç†
            if (tempStr === "\n"){
                lines.push(new TOLine(this.font, this.fontSize, lineStr));
                linePaths = [];
                lineWidth = 0;
                lineStr = "";
                continue;
            }
            let glyph = this.font.readGlyph(tempStr);
            
            if (!glyph){
                continue;
            }
            
            let path = glyph.getPath(0, 0, this.fontSize);
            let box = path.getBoundingBox();
            if (lineWidth + box.x2 < width){
                lineWidth += box.x2;
                linePaths.push(path);
                lineStr += tempStr;
            }else{
                lines.push(new TOLine(this.font, this.fontSize, lineStr));
                linePaths = [];
                lineWidth = 0;
                lineStr = "";
            }
        }
        if (lineStr.length > 0){
            lines.push(new TOLine(this.font, this.fontSize, lineStr));
        }
        
        return lines;
    };

    getSize (){
        
        let lines = this.readLines(this.width);
        let height = 0;
        for (let key in lines){
            let line = lines[key];
            height += line.getSize().height;
            height += this.fontSize/2;
        }
        if (height === 0){
            height = this.fontSize;
        }
        
//        width = Math.ceil(width);
//        height = Math.ceil(height);
        return {"width":this.width,"height":height};
    };

    draw (ctx, x, y, scale){
        if(!x){
            x=0;
        }
        if(!y){
            y=0;
        }
        if(!scale){
            scale=2.0;
        }
        let lines = this.readLines(this.width);

        for (let key in lines){
            let line = lines[key];
            let lineHeight = line.getSize().height;
            
            y += lineHeight;
            line.draw(ctx, x ,y,scale);
            y += this.fontSize/2;
        }
    }
}
class TOLine {
    constructor(font,fontSize,lineStr){
        this.lineStr = lineStr;
        this.font = font;
        this.fontSize = fontSize;
    };

    getSize (){
        let strArr = Array.from(this.lineStr);
        let width = 0,height = 0;
        for (let i=0;i<strArr.length;i++){
            let tempStr = strArr[i];

            let glyph = this.font.readGlyph(tempStr);
            if (!glyph){
                continue;
            }
            let path = glyph.getPath(0, 0, this.fontSize);
            let box = path.getBoundingBox();
            
            if (-box.y1 > height){
                height = -box.y1;
            }
            width += box.x2;
        }
        
        return {"width":width,"height":height};
    };

    draw (ctx, x, y, scale){
        if(!x){
            x=0;
        }
        if(!y){
            y=0;
        }
        if(!scale){
            scale=2.0;
        }
        x = x *scale;
        y = y *scale;
        let strArr = Array.from(this.lineStr);
        
        for (let i=0;i<strArr.length;i++){
            let tempStr = strArr[i];
            let glyph = this.font.readGlyph(tempStr);
            if (!glyph){
                continue;
            }
            let path = glyph.getPath(x, y, this.fontSize *scale);
            path.draw(ctx)

            let box = path.getBoundingBox();
            x = box.x2;
        }
    }
};

