class TOEmojiGlyph{
    constructor(x,y,width,height,image){
        this.rect = {x:x,y:y,height:height,width:width};
        this.image = image;
    };
    getPath (x,y,fontSize){
        return new TOEmojiPath (this.rect,x,y,fontSize,this.image);
    };
}
 
class TOEmojiPath{
    constructor (rect,x,y,fontSize,image){
        this.image = image;
        this.rect = rect;
        this.x = x;
        this.y = y;
        this.fontSize = fontSize;
    };
    getBoundingBox (){
        return {
            x1:this.x,
            x2:this.x + this.rect.width / 100 * this.fontSize ,
            y1: this.fontSize*0.3 - this.rect.height / 100 * this.fontSize,
            y2: this.fontSize*0.3
        }
    };
    
    draw (ctx){
        
        let width = this.rect.width / 100 * this.fontSize;
        let height = this.rect.height / 100 * this.fontSize
        ctx.drawImage(this.image,this.rect.x,this.rect.y,this.rect.width,this.rect.height,this.x,this.y-height + this.fontSize *0.3,width,height);
    };
}


